import "./NewExpense.css";

const NewExpense = () => {
  return (
    <form>
      <div className="new-expense__control">
        <div className="new-expense__control">
            <label>Title</label>
            <input type= 'text'/>
        </div>
        <div className="new-expense__control">
            <label>amount</label>
            <input type= 'number' min='0.01' step='0.01'/>
        </div>
        <div className="new-expense__control">
            <label>Date</label>
            <input type= 'date' min='2019-01-01' max='2022-12-31'/>
        </div>
      </div>
    </form>
  );
};

export default NewExpense;
